01447         template<size_t M>
01448         constexpr inline
01449         bool operator < (const reg_N_digs_t<M>& rarg) const noexcept {
01450                 const reg_digs_t & cthis{*this};
01451                 constexpr size_t P{std::min(L,M)};
01452                 constexpr size_t Q{std::max(L,M)};
01453                 constexpr bool L_gt_M{L>M};
01454 
01455                 if constexpr (L != M) {
01456                         for(size_t ix{P} ; ix < Q ; ++ix) {
01457                                 if constexpr (L_gt_M) {
01458                                         if (cthis[ix].is_not_0())
01459                                                 return false;
01460                                 }
01461                                 else {
01462                                         if (rarg[ix].is_not_0())
01463                                                 return true;
01464                                 }
01465                         }
01466                 }
01467 
01468                 for(int32_t ix{L} ; ix > -1 ; --ix)
01469                         if (cthis[ix] < rarg[ix])
01470                                 return true;
01471                 return false;
01472         }
