01863 template<typename UINT_T,UINT_T B,size_t N>
01864 constexpr inline
01865 reg_digs_t<UINT_T,B,N> m_incr(reg_digs_t<UINT_T,B,N>& rarg) noexcept {
01866         //using SIG_UINT_T = typename type_traits::sig_UInt_for_UInt_t<UINT_T>;
01867         using dig_t                      = dig_t<UINT_T,B>;
01868 
01869         dig_t carry{dig_t::dig_0()};
01870         for(size_t i=0 ; i < N ; ++i) {
01871                 if (i==0) {
01872                         if (rarg[0].is_Bm1()) {
01873                                 rarg[0].set_0();
01874                                 carry.set_1();
01875                         }
01876                         else {
01877                                 ++rarg[0];
01878                                 carry.set_0();
01879                                 break;
01880                         }
01881                 }
01882                 else {
01883                         if (carry.is_not_0()) {
01884                                 if (rarg[i].is_Bm1()) {
01885                                         rarg[i].set_0();
01886                                         carry.set_1();
01887                                 }
01888                                 else {
01889                                         ++rarg[i];
01890                                         carry.set_0();
01891                                         break;
01892                                 }
01893                         }
01894                         else {
01895                                 carry.set_0();
01896                                 break;
01897                         }
01898                 }
01899         }
01900         return (rarg);
01901 }
