01903 template<typename UINT_T,UINT_T B>
01904 constexpr inline
01905 dig_t<UINT_T,B>
01906 m_sum_digs_carryin1(dig_t<UINT_T,B>& left,dig_t<UINT_T,B> right) noexcept {
01907 
01908         using           dig_t                   = dig_t<UINT_T,B>;
01909         constexpr dig_t d_0 = dig_t::dig_0();
01910         constexpr dig_t d_1 = dig_t::dig_1();
01911 
01912         const dig_t left_CBm1{left.C_Bm1()};
01913         if(left.is_Bm1()) {
01914                 left = right;
01915                 return d_1;
01916         }
01917         else if (right.is_Bm1()) {
01918                 return d_1;
01919         }
01920         else if (left_CBm1 < right+d_1) {
01921                 left = right-left_CBm1;
01922                 return d_1;
01923         }
01924         else {
01925                 left += right;
01926                 ++left;
01927                 return d_0;
01928         }
01929 }
01930 
01931 template<typename UINT_T,UINT_T B>
01932 constexpr inline
01933 dig_t<UINT_T,B>
01934 m_sum_digs_carryin0(dig_t<UINT_T,B>& left,dig_t<UINT_T,B> right) noexcept {
01935 
01936         using dig_t                      = dig_t<UINT_T,B>;
01937         constexpr dig_t d_0 = dig_t::dig_0();
01938         constexpr dig_t d_1 = dig_t::dig_1();
01939 
01940         const dig_t left_CBm1{left.C_Bm1()};
01941         if (left_CBm1 >= right){
01942                 left += right;
01943                 return d_0;
01944         }
01945         else {
01946                 left = right-left_CBm1;
01947                 --left;
01948                 return d_1;
01949         }
01950 }
