01952 template<typename UINT_T,UINT_T B,size_t N>
01953         constexpr inline
01954         dig_t<UINT_T,B>
01955         m_sum(
01956                 reg_digs_t<UINT_T,B,N>& larg,
01957                 const reg_digs_t<UINT_T,B,N>& rarg
01958         ) noexcept
01959 {
01960         using dig_t                      = dig_t<UINT_T,B>;
01961         constexpr dig_t d_0 = dig_t::dig_0();
01962 
01963         dig_t carry{d_0};
01964         for(size_t i=0 ; i < N ; ++i) {
01965                 const dig_t left_CBm1{larg[i].C_Bm1()};
01966                 if (carry.is_0()) {
01967                         carry = m_sum_digs_carryin0(larg[i],rarg[i]);
01968                 }
01969                 else {
01970                         carry = m_sum_digs_carryin1(larg[i],rarg[i]);
01971                 }
01972         }
01973         return carry;
01974 }
