01978 template<typename UINT_T, UINT_T B, size_t N>
01979         requires (N>1)
01980 constexpr inline
01981 reg_digs_t<UINT_T,B,N> aprox_units_divB(const reg_digs_t<UINT_T,B,N>& arg) noexcept
01983 {
01988         using dig_t = dig_t<UINT_T,B>;
01989         reg_digs_t<UINT_T,B,N> cparg{arg};
01990         if ((cparg >> 1).is_0()) {
01991                 return cparg;
01992         }
01993         else if ((cparg[0]<= dig_t{B/2})||(cparg.is_any_B_pow())) {
01994                 cparg >>= 1;
01995                 return cparg;
01996         }
01997         else if (cparg[N-1].is_not_Bm1()) {
01998                 cparg >>= 1;
01999                 m_incr(cparg);
02000                 return cparg;
02001         }
02002         else {
02003                 auto temp = arg.template subregister<1,N>();
02004                 if (temp.is_filled_of_Bm1()){
02006                         cparg.set_0();
02007                         cparg[N-1].set_1();
02008                         return cparg;
02009                 }
02010                 else {
02012                         cparg >>= 1;
02013                         m_incr(cparg);
02014                         return cparg;
02015                 }
02016         }
02017 } 
