02051         using SIG_UINT_T = type_traits::sig_UInt_for_UInt_t<UINT_T>;
02052 
02053         std::array<SIG_UINT_T,2> ret;
02054 
02055         const size_t dsor_msb{static_cast<size_t>(dsor.index_of_MSDig())};
02056         const SIG_UINT_T rem_uint {SIG_UINT_T(rem)};
02057         const SIG_UINT_T dsor_uint {dsor[dsor_msb]()};
02058 
02059         SIG_UINT_T coc_calculado = rem_uint / dsor_uint;
02060         SIG_UINT_T rem_calculado = rem_uint % dsor_uint;
02061 
02062         if (dsor_msb==0) {
02064                 //const SIG_UINT_T rem_uint {SIG_UINT_T(rem)};
02065                 //const SIG_UINT_T dsor_uint {dsor[0]()};
02066                 //SIG_UINT_T coc_calculado = rem_uint / dsor_uint;
02067                 //SIG_UINT_T rem_calculado = rem_uint % dsor_uint;
02068                 const SIG_UINT_T rem_aprox {SIG_UINT_T(dsor)*coc_calculado+rem_calculado};
02069 
02070                 ret[1] = rem_calculado;
02071                 ret[0] = coc_calculado;
02072                 return ret;
02073         }
02074         else {
02077                 reg_digs_t<UINT_T,B,N> dsor_red{dsor};
02078                 uint64_t ix{0};
02079                 for( ; ix < N ; ++ix) {
02080                         dsor_red = aprox_units_divB<UINT_T,B,N>(dsor_red);
02081                         if (dsor_red.template index_of_MSDig<UINT_T,B,N>() == 1)
02082                                 break;
02083                 }
02084                 reg_digs_t<UINT_T,B,N> rem_red{rem};
02085 
02086                 for(int64_t iy{ix} ; iy > -1 ; --iy) {
02087                         rem_red = aprox_units_divB<UINT_T,B,N>(rem_red);
02088                 }
02089 
02090                 const SIG_UINT_T dsor_uint {SIG_UINT_T(dsor_red)};
02091                 const SIG_UINT_T rem_uint {SIG_UINT_T(rem_red)};
02092                 const reg_digs_t<UINT_T,B,N> rem_aprox {
02093                         dsor*dig_t{coc_calculado}+dig_t{rem_calculado}
02094                 };
02095 
02096                 if ((rem_aprox <= rem)&&(rem_aprox + dsor > rem)) {
02098                         ret[1] = rem_calculado;
02099                         ret[0] = coc_calculado;
02100                         return ret;
02101                 }
02102                 else if (rem_aprox > rem) {
02104                         --coc_calculado;
02105                         rem_calculado += dsor_uint;
02106                         return aprox_coc_rem<UINT_T,B,N>(rem,dsor,coc_calculado,rem_calculado);
02107                 }
02108                 else {
02110                         ++coc_calculado;
02111                         rem_calculado -= dsor_uint;
02112                         return aprox_coc_rem<UINT_T,B,N>(rem,dsor,coc_calculado,rem_calculado);
02113                 }
02114         }
02115 }
