02119 template<typename UINT_T, UINT_T B, size_t N>
02120         requires (N > 0)
02121 constexpr inline
02125 std::array<type_traits::sig_UInt_for_UInt_t<UINT_T>,2>
02126 aprox_coc_rem(
02127                 const reg_digs_t<UINT_T,B,N>& rem         ,
02128                 const reg_digs_t<UINT_T,B,N>& dsor      ,
02129                 type_traits::sig_UInt_for_UInt_t<UINT_T> coc_calculado  ,
