02137         if (dsor_msb==0) {
02139                 const SIG_UINT_T rem_aprox {SIG_UINT_T(dsor)*coc_calculado+rem_calculado};
02140                 const SIG_UINT_T rem_uint {SIG_UINT_T(rem)};
02141                 const SIG_UINT_T dsor_uint {dsor[0]()};
02142                 if ((rem_aprox <= rem_uint)&&(rem_aprox + dsor_uint > rem_uint)) {
02144                         ret[1] = rem_calculado;
02145                         ret[0] = coc_calculado;
02146                         return ret;
02147                 }
02148                 else if (rem_aprox > rem) {
02150                         --coc_calculado;
02151                         rem_calculado += dsor_uint;
02152                         return aprox_coc_rem<UINT_T,B,N>(rem,dsor,coc_calculado,rem_calculado);
02153                 }
02154                 else {
02156                         ++coc_calculado;
02157                         rem_calculado -= dsor_uint;
02158                         return aprox_coc_rem<UINT_T,B,N>(rem,dsor,coc_calculado,rem_calculado);
02159                 }
02161         }
02162         else {
02165                 reg_digs_t<UINT_T,B,N> dsor_red{dsor};
02166                 int32_t ix{0};
02167                 for( ; ix < N ; ++ix) {
02168                         dsor_red = aprox_units_divB<UINT_T,B,N>(dsor_red);
02169                         if (dsor_red.template index_of_MSDig<UINT_T,B,N>() == 1)
02170                                 break;
02171                 }
02172                 reg_digs_t<UINT_T,B,N> rem_red{rem};
02173                 for( ; ix > -1 ; --ix) {
02174                         rem_red = aprox_units_divB<UINT_T,B,N>(rem_red);
02175                 }
02176 
02177                 const SIG_UINT_T dsor_uint {SIG_UINT_T(dsor_red)};
02178                 const SIG_UINT_T rem_uint {SIG_UINT_T(rem_red)};
02179                 const reg_digs_t<UINT_T,B,N> rem_aprox {dsor*dig_t{coc_calculado}+dig_t{rem_calculado}};
02180 
02181                 if ((rem_aprox <= rem)&&(rem_aprox + dsor > rem)) {
02183                         ret[1] = rem_calculado;
02184                         ret[0] = coc_calculado;
02185                         return ret;
02186                 }
02187                 else if (rem_aprox > rem) {
02189                         --coc_calculado;
02190                         rem_calculado += dsor_uint;
02191                         return aprox_coc_rem<UINT_T,B,N>(rem,dsor,coc_calculado,rem_calculado);
02192                 }
02193                 else {
02195                         ++coc_calculado;
02196                         rem_calculado -= dsor_uint;
02197                         return aprox_coc_rem<UINT_T,B,N>(rem,dsor,coc_calculado,rem_calculado);
02198                 }
02199         }
