02204 template<typename UINT_T,UINT_T B,size_t N,size_t M>
02205         requires (N > 0)&&(M > 0)
02206 constexpr inline
02207 std::array<reg_digs_t<UINT_T,B,std::max(N,M)>,2>
02208 fediv(
02209         const reg_digs_t<UINT_T,B,N> & larg,
02210         const reg_digs_t<UINT_T,B,M> & rarg
02211 ) noexcept {
02212 
02213         constexpr size_t MaxParam = std::max(N,M);
02214         using base_t = reg_digs_t<UINT_T,B,MaxParam>;
02215         using SIG_UINT_T = type_traits::sig_UInt_for_UInt_t<UINT_T>;
02216 
02217         using ret_type = std::array<base_t,2>;
02218 
02219         base_t dndo{larg};
02220         base_t dsor{rarg};
02221 
02222         const int32_t dsor_MSDig{larg.index_of_MSDig()};
02224         const int32_t dndo_MSDig{rarg.index_of_MSDig()};
02226         const size_t  dist_dndo_dsor{std::abs(dndo_MSDig-dndo_MSDig)};
02227 
02228         base_t rem{base_t::regd_0()};
02229         base_t coc{base_t::regd_0()};
02230 
02231         if (is_0(dsor)) {
02232                 ret_type ret;
02233                 ret[0] = std::move(coc);
02234                 ret[1] = std::move(rem);
02235                 return ret;
02236         }
02237         else if (is_1(dsor)) {
02238                 ret_type ret;
02239                 ret[0] = dndo;
02240                 ret[1].set_0();
02241                 return ret;
02242         }
02243         else if (dndo < dsor) {
02244                 ret_type ret;
02245                 ret[0].set_0();
02246                 ret[1] = dndo;
02247                 return ret;
02248         }
02249         else if (dndo == dsor) {
02250                 ret_type ret;
02251                 ret[0].set_1();
02252                 ret[1].set_0();
02253                 return ret;
02254         }
02255         else {
02256                 int64_t pl_dndo{dndo_MSDig-dsor_MSDig+1};
02257                 for(int64_t ix{dsor_MSDig},iy{dndo_MSDig} ; ix>-1 ; --ix,--iy) {
02258                         rem[ix] = dndo[iy];
02259                 }
02260 
02261                 for(size_t numloops{0} ; numloops<dist_dndo_dsor ; ++numloops)
02262                 {
02263                         if (rem == dsor) {
02264                                 coc <<= 1;
02265                                 coc[0] = base_t::dig_1();
02266                                 rem = base_t::regd_0();
02267                                 --pl_dndo;
02268                                 rem[0] = dndo[pl_dndo];
02269                         }
02270                         else if (rem < dsor) {
02271                                 coc <<= 1;
02272                                 coc[0] = base_t::dig_0();
02273                                 rem <= 1;
02274                                 --pl_dndo;
02275                                 rem[0] = dndo[pl_dndo];
02276                         }
02280                         else {
02281                                 auto ret{aprox_coc_rem<N>(rem,dsor)};
02282                                 SIG_UINT_T coc_dig{ret[0]};
02283                                 SIG_UINT_T rem_dig{ret[1]};
02284 
02285                                 coc <<= 1;      // coc = coc * B
02286                                 coc[0] = dig_t(coc_dig); // coc = coc + D  ; B-1 >= D > 1
02287                                 --pl_dndo;
02288                                 rem <<= 1;
02289                                 rem[0] = dndo[pl_dndo];
02290                         }
02291                 }
02292                 std::array<reg_digs_t<UINT_T,B,std::max(N,M)>,2> ret;
02293                 ret[0] = coc;
02294                 ret[1] = rem;
02295                 return ret;
02296         }
02297 }
