02300   template<type_traits::unsigned_integral_c UINT_T,UINT_T B>
02301   bool get_digit_token(std::istream& is,dig_t<UINT_T,B>& dig_value)
02302   {
02303     std::string old_input_string{""};
02304     std::string new_input_string{""};
02305     size_t index{0};
02306     char input_char = type_traits::nullchar<char>;
02307     UINT_T uint_value = 0;
02308     dig_value = dig_t<UINT_T,B>::dig_0();
02309     while(true) {
02310       is >> input_char;
02311       if ((index==0)&&(lex::is_separator(input_char))) {
02312         new_input_string += input_char;
02313         old_input_string = new_input_string;
02314         ++index;
02315       }
02316       else if ((index == 0)&&(! lex::is_separator(input_char))) {
02317         std::cerr << "Has cometido un error, tenias que "
02318         << " escribir \" " << '#' << " \"  y has escrito "
02319         << new_input_string << std::endl;
02320         std::cerr << "Considera que has escrito "
02321         << old_input_string
02322         << " y continua escribiendo a partir de ahi";
02323         new_input_string = old_input_string;
02324       }
02325       else if((index>=1) && lex::is_digit(input_char)) {
02326         if (lex::digit_value(input_char) < B) {
02327           new_input_string += input_char;
02328           uint_value *= B;
02329           uint_value += lex::digit_value(input_char);
02330           if (uint_value < B) {
02331             old_input_string = new_input_string;
02332             dig_value = dig_t<UINT_T,B>(uint_value);
02333             ++index;
02334           }
02335           else {
02336             old_input_string = "#";
02337             std::cerr << "Has cometido un error, tenias que "
02338             << "poner un valor menor que la base y has "
02339             << "puesto \" " << uint_value << " \" escrito como \" "
02340             << new_input_string << " \" " << std::endl;
02341             uint_value = 0;
02342             return false;
02343           }
02344         }
02345         else if((index>=1) &&
02346                                                                 ! lex::is_digit(input_char) &&
02347                                                                 (input_char != '_')
02348                                         ) {
02349           std::cerr << "El caracter "
02350                                                                                 << input_char
02351                                                                                 << " no es valido aqui "
02352                                                                                 << std::endl;
02353           uint_value = 0;
02354           return false;
02355         }
02356       }
02357       else if((index>1)&&(input_char == '_')) {
02358         return true;
02359       }
02360       else{
02361         std::cerr << "Has cometido un error, tenias que escribir "
02362         << " \" " << "#digdigdig..._"
02363         << " \"  y has escrito "
02364         << new_input_string << std::endl;
02365         uint_value = 0;
02366         return false;
02367       }
02368     }
02369   }
