02377   template<type_traits::unsigned_integral_c T,T B,size_t L>
02378   bool get_digit_loop_token (
02379                 std::istream& is,reg_digs_t<T,B,L>& value
02380         ) noexcept {
02381                 size_t idx{0};
02382                 while(true) {
02383                         if(idx < L) {
02384                                 if (get_digit_token(is,value[idx])) {
02385                                         ++idx;
02386                                 }
02387                                 else {
02388                                         for(;idx < L;++idx) {
02389                                                 value[idx] = 0;
02390                                         }
02391                                         std::cerr << " error consiguiendo el digito " << idx
02392                                                                                 << std::endl;
02393                                         std::cerr << " digitos a 0 a partir del indice = " << idx
02394                                                                                 << std::endl;
02395                                         return false;
02396                                 }
02397                         }
02398                         if (idx >= L)
02399                                 return true;
02400                 }
02401         }
