02403         template<type_traits::unsigned_integral_c T,T B,size_t L>
02404         bool read (std::istream& is,reg_digs_t<T,B,L>& value)
02405         noexcept {
02406                 //std::cerr
02407                 reg_digs_t<T,B,L> default_value{};
02408                 bool type_token = reg_digs_t<T,B,L>::get_type_template_string_id_token(is);
02409                 if (type_token) {
02410                         if (get_digit_loop_token(is,value)) {
02411                                 if (dig_t<T,B>::get_radix_token(is)) {
02412                                         return true;
02413                                 }
02414                                 else {
02415                                         value = default_value;
02416                                         return false;
02417                                 }
02418                         }
02419                         else {
02420                                 value = default_value;
02421                                 return false;
02422                         }
02423                 } else {
02424                         value = default_value;
02425                         return false;
02426                 }
02427         }
