02431   using namespace type_traits;
02432         template<uint128_t B>
02433         using digit_t = dig_t<
02434                         TypeFromIntNumber_t<static_cast<uint128_t>(B)>,
02435                         static_cast<TypeFromIntNumber_t<static_cast<uint128_t>(B)>>(static_cast<uint128_t>(B))
02436                 >;
02437         template<uint128_t B, size_t L>
02438         using register_digs_t = reg_digs_t<
02439                         TypeFromIntNumber_t<static_cast<uint128_t>(B)>,
02440                         static_cast<TypeFromIntNumber_t<static_cast<uint128_t>(B)>>(static_cast<uint128_t>(B)),
02441                         L
02442         >;
02443 
02445         template<typename Int_Type,Int_Type Base,size_t Length>
02446                 requires (type_traits::suitable_base<Int_Type,Base>()&&(Length > 0))
02447         std::istream &
02448         operator >> (std::istream & is,reg_digs_t<Int_Type,Base,Length> & arg) {
02449                 enum estado_e {
02450                         e0ini   , e1r           , e1e           , e1g                   , e1sep         ,
02451                         e1d             , e1i           , e2g           , e2start       , e2dig         ,
02452                         e2dp    , e2end , e2B           , e3dig         , e0fin
02453                 };
02455                 constexpr size_t longitud_cadena
02456                         {
02457                                 (
02458                                         (Length+1)*
02459                                         static_cast<size_t>(
02460                                                 std::ceil(
02461                                                         (
02462                                                                 std::log2(static_cast<long double>(Base)) + 1
02463                                                         )
02464                                                 )
02465                                         )
02466                                 )       +16
02467                         };
02468                 std::string sds{};
02469                 sds.resize(longitud_cadena);
02470                 sds.assign(longitud_cadena,'\0');
02472                 using inttype           = typename type_traits::sig_UInt_for_UInt_t<Int_Type>;
02473                 using dig_t                     = dig_t<Int_Type,Base>;
02474                 using reg_digs_t        = reg_digs_t<Int_Type,Base,Length>;
02476                 size_t  indice{0};
02478                 Int_Type digito{0};
02479                 size_t longitud{0};
02480                 inttype numero_base_recogido{0};
02482                 reg_digs_t& numero_ret{arg};
02484                 estado_e est_act = e0ini;
02486                 char c = type_traits::nullchar<char>;
02488                 is >> sds;
02490                 do {
02491                 c = sds[indice];
02492                         switch(est_act) {
02493                                 case e0ini :
02494                                         {
02495                                                 if (c=='r') {
02496                                                         est_act = e1r;
02497                                                 } else {
02498                                                         est_act = e0ini;
02499                                                 }
02500                                         }
02501                                         break;
02502                                 case e1r :
02503                                         {
02504                                                 {
02505                                                         if (c=='e') {
02506                                                                 est_act = e1e;
02507                                                         }
02508                                                         else {
02509                                                                 est_act = e0ini;
02510                                                         }
02511                                                 }
02512                                         }
02513                                         break;
02514                                 case e1e :
02515                                         {
02516                                                 if (c=='g') {
02517                                                         est_act = e1g;
02518                                                 }
02519                                                 else  {
02520                                                         est_act = e0ini;
02521                                                 }
02522                                         }
02523                                         break;
02524                                 case e1g :
02525                                         {
02526                                                 if (c=='_') {
02527                                                         est_act = e1sep;
02528                                                 }
02529                                                 else  {
02530                                                         est_act = e0ini;
02531                                                 }
02532                                         }
02533                                         break;
02534                                 case e1sep :
02535                                         {
02536                                                 if (c=='d') {
02537                                                         est_act = e1d;
02538                                                 }
02539                                                 else  {
02540                                                         est_act = e0ini;
02541                                                 }
02542                                         }
02543                                         break;
02544                                 case e1d :
02545                                         {
02546                                                 if (c=='i') {
02547                                                         est_act = e1i;
02548                                                 }
02549                                                 else  {
02550                                                         est_act = e0ini;
02551                                                 }
02552                                         }
02553                                         break;
02554                                 case e1i :
02555                                         {
02556                                                 if (c=='g') {
02557                                                         est_act = e2g;
02558                                                 }
02559                                                 else  {
02560                                                         est_act = e0ini;
02561                                                 }
02562                                         }
02563                                         break;
02564                                 case e2g :
02565                                         {
02566                                                 if (c=='#') {
02567                                                         est_act = e2start;
02568                                                 }
02569                                                 else  {
02570                                                         est_act = e0ini;
02571                                                 }
02572                                         }
02573                                         break;
02574                                 case e2start :
02575                                         {
02576                                                 if (((c>='0')&&(c<='9'))&&(std::abs(c-'0')<Base)) {
02577                                                         est_act = e2dig;
02578                                                         digito = (c-'0');
02579                                                         longitud = 0;
02580                                                         numero_base_recogido = 0;
02581                                                         numero_ret = reg_digs_t::regd_0();
02582                                                 }
02583                                                 else  {
02584                                                         est_act = e0ini;
02585                                                         digito = 0;
02586                                                         longitud = 0;
02587                                                         numero_base_recogido = 0;
02588                                                         numero_ret = reg_digs_t::regd_0();
02589                                                 }
02590                                         }
02591                                         break;
02592                                 case e2dig :
02593                                         {
02594                                                 const bool dig_c {(c >= '0') && (c <= '9')};
02595                                                 const bool dig_lt_Base{digito<Base};
02596                                                 const bool c_es_dig_B {dig_c && dig_lt_Base};
02597                                                 const bool dig_B_cdl {c_es_dig_B && (longitud <= Length-1)};
02598                                                 const bool tt_dig_B_cdl {(c==':')&&dig_lt_Base&&(longitud <= Length-1)};
02599                                                 const bool tf_dig_B_cdl {(c=='#')&&dig_lt_Base&&(longitud == Length-1)};
02600                                                 if (dig_B_cdl) {
02601                                                         digito *= 10;
02602                                                         digito += (c-'0');
02603                                                         est_act = e2dig;
02604                                                 }
02605                                                 else if (tt_dig_B_cdl) {
02606                                                         est_act = e2dp;
02607                                                 }
02608                                                 else if (tf_dig_B_cdl) {
02609                                                         est_act = e2end;
02610                                                 }
02611                                                 else  {
02612                                                         est_act = e0ini;
02613                                                         digito = 0;
02614                                                         longitud = 0;
02615                                                         numero_base_recogido = 0;
02616                                                         numero_ret = reg_digs_t::regd_0();
02617                                                 }
02618                                         }
02619                                         break;
02620                                 case e2dp :
02621                                         {
02622                                                 const bool dig_c {(c >= '0') && (c <= '9')};
02623                                                 const bool c_es_dig_B {(std::abs(c-'0')<Base) && (digito<Base)};
02624                                                 const bool dig_B_cdl {dig_c && c_es_dig_B && (longitud < Length-1)};
02625                                                 const bool rdig_B_cdl {dig_c && c_es_dig_B && dig_B_cdl};
02626                                                 if (rdig_B_cdl) {
02627                                                         est_act = e2dig;
02628                                                         numero_ret[Length-1-longitud] = dig_t(digito);
02629                                                         ++longitud;
02630                                                         digito = c-'0';
02631                                                 }
02632                                                 else  {
02633                                                         est_act = e0ini;
02634                                                         digito = 0;
02635                                                         longitud = 0;
02636                                                         numero_base_recogido = 0;
02637                                                         indice = 0;
02638                                                         numero_ret = reg_digs_t::regd_0();
02639                                                 }
02640                                         }
02641                                         break;
02642                                 case e2end :
02643                                         {
02644                                                 const bool c_es_sepfin {c == 'B'};
02645                                                 const bool d_es_digB {digito < Base};
02646                                                 const bool l_coincide {longitud == Length-1};// llega al cero ?
02647                                                 const bool rdigB_cdl {c_es_sepfin && d_es_digB && l_coincide};
02648                                                 if (rdigB_cdl) {
02649                                                         est_act = e2B;
02650                                                         numero_ret[Length-1-longitud] = dig_t(digito);
02651                                                         digito = 0;
02652                                                         longitud = 0;
02653                                                 }
02654                                                 else  {
02655                                                         est_act = e0ini;
02656                                                         indice = 0;
02657                                                         digito = 0;
02658                                                         longitud = 0;
02659                                                         numero_ret = reg_digs_t::regd_0();
02660                                                 }
02661                                         }
02662                                         break;
02663                                 case e2B :
02664                                         {
02665                                                 if ((c >= '0')&&(c <= '9')) {
02666                                                         est_act = e3dig;
02667                                                         numero_base_recogido = c-'0';
02668                                                         digito = 0;
02669                                                 }
02670                                                 else  {
02671                                                         est_act = e0ini;
02672                                                         digito = 0;
02673                                                         longitud = 0;
02674                                                         numero_base_recogido = 0;
02675                                                         numero_ret = reg_digs_t::regd_0();
02676                                                 }
02677                                         }
02678                                         break;
02679                                 case e3dig :
02680                                         {
02681                                                 const bool espacio_c {c < 16};
02682                                                 const bool digito_c {(c>='0') && (c<='9')};
02683                                                 const bool num_base_lt_Base {numero_base_recogido < Base};
02684                                                 const bool num_base_eq_Base {numero_base_recogido == Base};
02685                                                 if (digito_c && num_base_lt_Base) {
02686                                                         est_act = e3dig;
02687                                                         numero_base_recogido *= 10;
02688                                                         numero_base_recogido += (c-'0');
02689                                                 }
02690                                                 else if (espacio_c && num_base_eq_Base) {
02691                                                         numero_base_recogido *= 10;
02692                                                         numero_base_recogido += (c-'0');
02693                                                                 est_act = e0fin;
02694                                                                 numero_base_recogido = 0;
02695                                                 }
02696                                                 else  {
02697                                                         est_act = e0ini;
02698                                                         numero_base_recogido = 0;
02699                                                 }
02700                                         }
02701                                         break;
02702                                 case e0fin :
02703                                         {
02704                                                 est_act = e0fin;
02705                                         }
02706                         }
02707                         ++indice;
02708                 } while (est_act!=e0fin);
02709 
02710                 return (is);
02711         }
02712 
02713         template<typename Int_Type,Int_Type Base,size_t Long>
02714                 requires (type_traits::suitable_base<Int_Type,Base>())
02715         std::ostream &
02716         operator << (
02717                         std::ostream & os,
02718                         const reg_digs_t<Int_Type,Base,Long> & arg)
02719         {
02720                 using inttype = ullint_t;
02721                 os << "reg_dig#";
02722                 for(int32_t ix{Long-1} ; ix > 0 ; --ix) {
02723                                 os << static_cast<inttype>(arg[ix]());
02724                                 os << ':';
02725                 }
02726                 os << static_cast<inttype>(arg[0]());
02727                 os << "#B";
02728                 os << static_cast<inttype>(Base);
02729                 return (os);
02730         }
